import './Navbar.css';
import { FaDollarSign, FaShoppingCart, icons } from "react-icons/fa";
import {Link} from "react-router-dom";

function Navbar() {
  
  return (

    <div className="navbar">
         <span className='Fad'>
            <FaDollarSign />
            <FaShoppingCart />
         </span>
    </div>

  );
}

export default Navbar;
